šení  Klávesnice KB813 se čtečkou čipových karet od společnosti Dell™ nabízí vysoké zabezpečení. Jde o komplexní řešení pro ochranu dat a duševního vlastnictví díky pohodlné a stylové klávesnici s integrovanou čtečkou čipových karet. Tato klávesnice se čtečkou čipových karet nabízí pro pohodlné psaní dlouhodobou výdrž, odolnost proti polití, nízká a tichá tlačítka a odnímatelnou opěrku na dlaně. Připojení kabelem zajišťuje bezpečné a rychlé přenosy dat a ověřování. Kabel USB lze snadno připojit prakticky ke všem počítačům Dell. Tento výrobek byl testován a ověřen se zařízeními Dell. Pokud ho používáte se zařízením Dell, vztahuje se na něj technická podpora společnosti Dell.  Odkaz na stránky výrobce:  http://accessories.euro.dell.com/sna/productdetail.aspx?c=cz&amp;l=cs&amp;s=dhs&amp;cs=czdhs1&amp;sku=580-18352","false","22","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","792.00","KS","0.00","3","2019-08-14T10:52:42.8","DLL","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422531_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422531_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422531_0c_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>884</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1439794","552288","4GB DDR4 2666MHz, KINGSTON Brand  (KCP426NS6/4)","446.50","448.00","KIN","1.50","0.00","0.000000","0.000","99 Doživotní","KINGSTON","449.00","542.00","21.00","KCP426NS6/4","false","0,00","","Kingston","85423239","740617282740","4GB DDR4 2666MHz, KINGSTON Brand  (KCP426NS6/4)","Druh příslušenství k PC:Paměťový modul","1","&lt;p&gt;Acer - Aspire TC-885&lt;br /&gt;Acer - Aspire X Series AXC-8