evnost krabičky zajišťuje integrovaný ochranný rám a 4 ocelové šrouby, které pevně propojují dno s víkem. Pro zvýšení stability jsou navíc součástí balení i 4 protiskluzové nožičky.&lt;/p&gt;  &lt;p&gt;Pro kompletaci nejprve musíte do krabičky vložit Raspberry Pi stranou s konektory a následně stačí jen Raspberry Pi docvaknout.&lt;/p&gt;  &lt;br&gt;  &lt;p&gt;TECHNICKÉ PARAMETRY&lt;/p&gt;  &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Model&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Raspberry Pi 4B&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Materiál&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;PLA&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Barva&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;bílá &lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozměry&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;101x 74 x 27 mm &lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Přístupné porty a konektory&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Přístupné porty a konektory: napájecí microUSB, 4 USB 2.0, Ethernet, 2x microHDMI, jack, slot na micro SD kartu, GPIO, kamera a displej*&lt;br /&gt;*Průřezy v krabičce umožňující vyvedení plochých kabelů a drátových propojek.&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Doporučené příslušenství&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Hliníkový chladič 20 x 20 x 19,1mm&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 