,"1726.00","2110.00","21.00","OFI009","false","0,00","Dočasně nedostupné","Raspberry","84733080","640522710386","Raspberry Pi 7' dotykový displej, 800x480, kapacitní, DSI","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;span style='font-size: 10pt;'&gt;&lt;strong&gt;Raspberry Pi 7' dotykový displej, 800x480, kapacitní, DSI&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;Oficiální dotykový displej pro Raspberry Pi s úhlopříčkou 7', rozlišením 800x480 bodů a konektorem DSI.&lt;/p&gt;  &lt;p&gt;Díky kapacitní technologii dotykového panelu nabízí tento displej stejný uživatelský konfort, jako displej chytrého telefonu či tabletu. Nepotřebujete při dotyku vyvíjet tlak, jako u rezistivních panelů. Je perfektní pro stavbu integrovaných “all-in-one” systémů z Raspberry Pi!&lt;/p&gt;  &lt;p&gt;Pro jedoduché spojení s Raspberry Pi má displej na své zadní straně připevněnou řídící desku. Díky této desce stačí ke spojení displeje s Raspberry Pi 1 DSI kabel pro přenos všech signálů a 2 drátové propojky pro jeho napájení.&lt;/p&gt;  &lt;p&gt;Dotyková obrazovka rozpozná až 10 dotyků najednou a podporuje klávesnici na obrazovce.&lt;/p&gt;  &lt;p&gt;Displej má plnou podporu systémů Raspbian, Ubuntu MATE, LibreELEC, OSMC, Windows IoT a dalších.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Rozlišení: 800x480&lt;/li&gt;  &lt;li&gt;Konektivita: DSI port&lt;/li&gt;  &lt;li&gt;Typ panelu: LCD&lt;/li&gt;  &lt;li&gt;Snímání dotyku: kapacitní&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1× Kapacitně dotykový 7' LCD displej&lt;/li&gt;  &lt;li&gt;1× Řídící deska&lt;/li&gt;  &lt;li&gt;1× Plochý DSI kabel&lt;/li&gt;  &lt;li&gt;4× Kovové distanční sloupky a šroubky&lt;/li&gt;  &lt;li&gt;4× Drátové propojky female/female&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Parametry:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Typ displeje - LCD&lt;/li&gt;  &lt;li&gt;Typ dotykové vrstvy - Kapacitní&lt;/li&gt;  &lt;li&gt;Úhlopříčka displeje - 7'&lt;/li&gt;  &lt;li&gt;Rozlišení displeje - 800 x 480&lt;/li&gt;  &lt;li&gt;Typ video konektoru - DSI&lt;/li&gt;  &lt;li&gt;Typ dotykového konektoru - DSI&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;","false","10","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1726.00","KS","0.00","6","2019-11-05T08:17:41.25","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494736_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494736_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494736_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494736_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494736_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494736_0f_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.338</weight>          <length>26</length>          <width>15</width>          <height>4</height>        </productlogisticdata>      ","N","","false",""),("1494740","440945","Raspberry Pi přídavná deska Serial Pi Plus","393.50","395.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","393.00","535.00","21.00","ABE008","true","1,00","Výprodej","Raspberry","84733080","7426787870194","Raspberry Pi přídavná deska Serial Pi Plus","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;span style='font-size: 10pt;'&gt;&lt;strong&gt;Raspberry Serial Pi Plus&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;HAT deska, rozšiřující Raspberry Pi o sériový port RS232.&lt;/p&gt;  &lt;p&gt;Ovládejte své Raspberry Pi přes sériový port RS232, nebo jeho pomocí připojte externí sériové příslušenství! Serial Pi Plus lze navíc stohovat. Stohovatelné rozšiřující HAT desky je možné nasadit nad sebe na jedno Raspberry Pi, avšak Serial Pi Plus můžete ve 'stohu' použít jen jednou.&lt;/p&gt;  &lt;br&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;AT deska, rozšiřující Raspberry Pi o sériový port RS232&lt;/li&gt;  &lt;li&gt;Port RS232 je připojený na UART port Raspberry Pi pomocí rozhraní MAX3232. MAX3232 IC převádí 3.3V UART port na napětí RS232, a tak umožňuje komunikaci s RS232 kompatibilními zařízeními přes DB9 sériový kabel nebo za použití null modemu. Deska umožňuje terminálový přístup k linuxu na Raspberry Pi. Na port RS232 lze přistoupit skrz DB9 port nebo přes pájecí piny na desce.&lt;/li&gt;  &lt;li&gt;Serial Pi Plus také obsahuje pole 2,54mm děr s 3,3V a 5V napájením pro vlastní obvody.&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1x Serial Pi Plus&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","2","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","393.00","KS","1.00","4","2020-01-15T15:34:19.98","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494740_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494740_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494740_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1494\/1494740_0d_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.024</weight>          <length>6.5</length>          <width>6</width>          <height>2</height>        </productlogisticdata>      ","N","","false",""),("1495240","440947","Hliníkový chladič pro Raspberry Pi - 20 x 20 x 19,1 mm","84.00","84.00","RSP","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","84.00","111.00","21.00","HTS008","false","0,00","","Raspberry","847330