s vyšším rozlišením.&lt;/p&gt;  &lt;p&gt;Pi kamerou můžete natáčet HD videa a pořizovat fotografie s rozlišením až 3280x2464 px.&lt;br /&gt;Pi kamera funguje se všemi modely Raspberry Pi, které mají kamerový CSI port, používá MMAL a V4L API.&lt;/p&gt;  &lt;br&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;VideoFPS: 1080p30, 720p/60&lt;/li&gt;  &lt;li&gt;Fotky: 3280x2464 px&lt;/li&gt;  &lt;li&gt;Čip: 8Mpx Sony IMX219 CCD&lt;/li&gt;  &lt;li&gt;Konektor: CSI&lt;/li&gt;  &lt;li&gt;Rozměry: 25 × 20 × 9 mm&lt;/li&gt;  &lt;li&gt;Noční vidění: NE&lt;/li&gt;  &lt;li&gt;Verze: 2&lt;/li&gt;  &lt;li&gt;IR filtr: ANO&lt;/li&gt;  &lt;li&gt;Montážních otvory: 4&lt;/li&gt;  &lt;li&gt;Zpětně kompatibilita s verzí 1: ANO&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Podpora&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Raspberry Pi Learning Resources&lt;/li&gt;  &lt;li&gt;Getting started with picamera&lt;/li&gt;  &lt;li&gt;Picamera Python Library.&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1x Raspberry Pi kamera V2&lt;/li&gt;  &lt;li&gt;1x 15cm flex kabel&lt;/li&gt;  &lt;/ul&gt;","false","0","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","614.00","KS","5.00","5","2020-01-15T15:44:15.61","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1502\/1502232_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1502\/1502232_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1502\/1502232_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1502\/1502232_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1502\/1502232_0e_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.026</weight>          <lengt