"431122","ASUS záslepka do PC case, zadní, LPT kabel 300mm","32.30","34.00","ASU","1.70","0.00","0.000000","0.000","24 Měsíc(ů)","ASUS MB, VGA","32.00","37.00","21.00","14G000003902","true","50-99","Výprodej","Asus","85442000","431122","ASUS záslepka do PC case, zadní, LPT kabel 300mm","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;LPT bracket v délce 300mm pro připojení k základním deskám, které mají piny na desce pro tuto záslepku. Kompatibilní s deskami značek ASUS, Intel, MSI, Gigabyte a AsRock.&lt;/p&gt;","false","2","0001013700180006","8774","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","32.00","KS","53.00","2","2020-06-05T12:04:59.683","ASU","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1519\/1519434_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1519\/1519434_0b_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.05</weight>          <length>16.5</length>          <width>13</width>          <height>2.5</height>        </productlogisticdata>      ","N","","false",""),("1522569","794285","ZALMAN RGB CONTROLLER Z-SYNC","397.00","397.00","COO","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","ZALMAN","398.00","429.00","21.00","Z-SYNC","false","0,00","","Zalman","84733080","8809213769856","ZALMAN RGB CONTROLLER Z-SYNC","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;strong&gt;Z-SYNC Z-SYNC DIGITAL ARGB CONTROLLER&lt;/strong&gt;&lt;br /&gt;The Z-Sync from Zalman is a combined hub and controller that serves as a practical control center for up to eight digitally addressable RGB LED products. Thanks to conventional 3-pin connections (5VDG), it is compatible with almost all RGB LED strips or fans with the corresponding plug. The highlight of the Z-Sync is that it also works on mainboards without RGB-LED slots. To do this, it is simply connected to a free USB 2.0 slot . The lighting is controlled using the Z-Sync software or even the Razer Chroma control.&lt;/p&gt;  &lt;p&gt;The features of the Z-Sync controller / hub from Zalman at a glance:&lt;br /&gt;- RGB LED controller / hub for digitally addressable LED products&lt;br /&gt;- Eight 3-pin connectors (5VDG)&lt;br /&gt;- Connection to a free USB 2.0 port on the mainboard&lt;br /&gt;- Control of lighting via Z-Sync or Razer Chroma software&lt;br /&gt;- Easy assembly with double-sided adhesive tape&lt;/p&gt;  &lt;p&gt;The features of the Z-Sync controller / hub from Zalman in detail&lt;br /&gt;The Z-Sync controller / hubs from Zalman has eight channels to which digital addressable RGB LEDs can be connected. RGB LED products with a total current of 4 amps can be connected in the 3-pin connectors. In this way, even more than eight RGB LED components can be connected using a distribution cable or daisy chaining.&lt;/p&gt;  &lt;p&gt;The Z-Sync controller / hubs from Zalmancan be easily installed thanks to the double-sided adhesive strips already attached. With a height of only 12 millimeters, the Z-Sync can also be attached to the back of a mainboard tray. With its side dimensions of 79 x 49 millimeters, it easily fits into a free 2.5-inch SSD slot. The power supply is via SATA cable via the power supply. To connect to the mainboard, it must have a free USB 2.0 header. As soon as the controller is connected, the RGBs are controlled via the Zalman-Z-Sync or Razer-Chroma software .&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Technical details:&lt;/strong&gt;&lt;br /&gt;- Dimensions: 79 x 49 x 12 mm (W x H x D)&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Connections:&lt;/strong&gt;&lt;br /&gt;- Input: USB 2.0 (5-pin / micro-USB, via header on the mainboard)&lt;br /&gt;- Output: 8x 3-pin RGB header (5VDG, max. 4 A)&lt;br /&gt;- Power supply: 5 V, (via SATA from the power supply)&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Contents:&lt;/strong&gt;&lt;br /&gt;- 1x Z-Sync controller / hub&lt;br /&gt;- 1x USB connection&lt;br /&gt;- Cable 1x power cable (SATA)&lt;br /&gt;- 1x splitter (3-pin / 3x 3-pin)CONTROLLER&lt;br /&gt;RGB controller / hub  Eight channels for digital addressable RGB LEDs (3-pin 5VDG)  Connection to mainboard via USB 2.0 port  Control via Z-Sync or Razer Chroma software  Easy Installation&lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","398.00","KS","0.00","4","2020-07-16T12:13:31.087","ZAL","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522\/1522569_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522\/1522569_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522\/1522569_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1522\/1522569_0d_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.103</weight>          <length>16</length>          <width>10.5</width>          <height>3</height>        </productlogisticdata>      ","N","","false",""),("1525103","1558015","Waveshare 13.3' HDMI LCD (H) displej, IPS, 1920x1080, dotykový, kapacitní + kryt, aktualizovaná verze","4229.50","4231.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","4229.00","4229.00","21.00","WAV059","true","4,00","","Raspberry","84733080","1558015","Waveshare 13.3' HDMI LCD (H) displej, IPS, 1920x1080, dotykový, kapacitní + kryt, aktualizovaná verze","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;strong&gt;Waveshare 13,3' HDMI LCD (H) displej, IPS, 1920x1080, dotykový, kapacitní + kryt, aktualizovaná verze&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Kapacitně dotykový LCD displej s úhlopříčkou 13,3', rozlišením 1920x1080, IPS technologií, HDMI rozhraním a speciálním krytem s ovládacimí tlačítky a vestavěným reproduktorem!&lt;/p&gt;  &lt;p&gt;&lt;st