         <typ>JEDN</typ>          <count>1</count>          <weight>0.879</weight>          <length>23</length>          <width>19</width>          <height>10</height>        </productlogisticdata>        <productlogisticdata>          <typ>PACK</typ>          <count>6</count>          <weight>5.555</weight>          <length>60</length>          <width>20</width>          <height>25</height>        </productlogisticdata>      ","N","","false",""),("1551886","1558050","Suptronics přídavná deska X825 2.5' SATA HDD/SSD Shield","627.50","629.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","627.00","627.00","21.00","SUP006","false","0,00","","Raspberry","84733080","1558050","Suptronics přídavná deska X825 2.5' SATA HDD/SSD Shield","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;strong&gt;Suptronics X825 2.5' SATA HDD/SSD Shield&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Rozšiřující deska X825 2.5' SATA HDD/SSD nabízí snadný a rychlý způsob, jak vytvořit úložiště pro Raspberry Pi 4B. &lt;br /&gt;Jeho elegantní a ultrakompaktní design umožňuje pohodlné připojení 2.5' HDD / SSD k Raspberry Pi. Port SuperSpeed USB 3.0 poskytuje extrémní rychlost přenosu dat až 5 Gbps, což vám umožní přenášet velké množství dat během několika sekund. Montážní otvory a distanční prvky pomáhají chránit pevný disk a současně účinně odvádějí teplo, což přispívá ke spolehlivému chodu. Vestavěná LED dioda indikuje stav čtení nebo zápisu.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Pro použití s - Raspberry Pi 4 Model B&lt;/li&gt;  &lt;li&gt;Operační systém - Všechny operační systémy pro Raspberry Pi&lt;/li&gt;  &lt;li&gt;Ideální řešení pro ukládání pro Raspberry Pi 4 - 2.5' SATA HDD/SSD Shield&lt;/li&gt;  &lt;li&gt;Podpora až 4TB 2.5' SATA HDD / SSD&lt;/li&gt;  &lt;li&gt;Integrovaný můstek z USB 3.1 Gen1 na SATA 6Gb/s&lt;/li&gt;  &lt;li&gt;USB3.1 Gen1 5Gb/s připojení plug-and-play pro Raspberry Pi&lt;/li&gt;  &lt;li&gt;Umožňuje spouštění OS z vašeho HDD / SSD (viz. Poznámky)&lt;/li&gt;  &lt;li&gt;Kompatibilní s USB 2.0&lt;/li&gt;  &lt;li&gt;Integrované tlačítko pro zapnutí / vypnutí napájení (Stisknutí - ON, podržte tlačítko stisknuté alespoň 2s - OFF)&lt;/li&gt;  &lt;li&gt;Napájejte RPI pomocí 40 pinového headeru, což vyžaduje pouze jeden zdroj&lt;/li&gt;  &lt;li&gt;Integrované napájecí konektory XH2.54 umožňující napájení dalších zařízení&lt;/li&gt;  &lt;li&gt;červená kontrolka indikuje stav napájení a modrá kontrolka značí stav jednotky&lt;/li&gt;  &lt;li&gt;Speciálně vyrobená propojka USB3.1 pro připojení k Raspberry Pi - není třeba dalších kabelů&lt;/li&gt;  &lt;li&gt;Montážní otvory a distanční sloupky zajišťující mechanickou stabilitu sestavy Raspberry Pi a X825&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X735 pro inteligentní správu napájení a chlazení Raspberry Pi&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X710 pro široké vstupní napětí (6 ~ 36V) a inteligentní správu napájení&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X765 pro napájení přes Ethernet (POE, 5V 5A)&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X725 pro nepřerušitelný zdroj napájení (18650 UPS, 5,1V/8A, WOL)&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X728 - UPS deska pro inteligentní napájení.&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Poznámky:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Karta microSD je nutná k tomu, aby Raspbian OS donutil používat HDD / SSD pro svůj kořenový „root“ oddíl&lt;/li&gt;  &lt;li&gt;Pro použití pouze s originálním napájecím zdrojem&lt;/li&gt;  &lt;li&gt;Zařízení USB 3.0 mohou generovat vysokofrekvenční rušení, které může způsobit, že Wi-Fi a další bezdrátová zařízení pracující v pásmu 2,4 GHz budou mít problémy s komunikací s Raspberry Pi4. Chcete-li se vyhnout rušení v pásmu 2,4 GHz pomocí Wi-Fi, zkuste místo toho použít pásmo 5 GHz. Pokud problém přetrvává, vypněte Wi-Fi a místo toho použijte připojení přes ethernet.&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;Upozornění: Nenapájejte své Raspberry Pi zároveň z 40-pinového headeru a přes USB-C napájení. Vždy používejte jen jeden zdroj napájení&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Specifikace:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Napájecí zdroj: 5V +/-5% , 4A&lt;/li&gt;  &lt;li&gt;Porty:&lt;br /&gt;- DC jack - 5,5x2,5mm&lt;br /&gt;- USB - USB 3.0 type A&lt;/li&gt;  &lt;li&gt;Konektory:&lt;br /&gt;- Napájecí výstupní konektor - XH2.54 2-pin&lt;br /&gt;- Napájecí přepínací konektor - PH2.0 4-pin&lt;/li&gt;  &lt;li&gt;Rozměry: 107,5mm x 85m&lt;/li&gt;  &lt;li&gt;Doporučený zdroj: &lt;a href='https://rpishop.cz/zdroje/3091-25x55mm-5v4a-napajeci-zdroj-eu-cerny.html'&gt;2,5x5,5mm 5V?4A napájecí zdroj, EU, černý&lt;/a&gt;&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1 x Deska X825&lt;/li&gt;  &lt;li&gt;1 x Propojka USB3.1&lt;/li&gt;  &lt;li&gt;1 x Napájecí dceřiná deska&lt;/li&gt;  &lt;li&gt;1 x 2 pinový kabel pro připojení napájení&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek F/F M2.5 x 12mm&lt;/li&gt;  &lt;li&gt;1 x Distanční sloupek M/F M2.5 x 11mm&lt;/li&gt;  &lt;li&gt;8 x Šroub M2.5 x 5mm&lt;/li&gt;  &lt;li&gt;6 x Šroub M3 x 6mm&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek F/F M3 x 15mm&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","627.00","KS","0.00","6","2021-01-25T16:14:25.383","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551886_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551886_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551886_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551886_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551886_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551886_0f_3.jpg'}","        <productnavigatordata>          <attributecode>196</at