t;/li&gt;  &lt;li&gt;Rychlý přenos souborů z PC nebo Macu pomocí vysokorychlostního připojení USB 3.1&lt;/li&gt;  &lt;li&gt;Červená LED kontrolka indikuje stav napájení a modrá kontrolka označuje stav jednotky&lt;/li&gt;  &lt;li&gt;Napájení Raspberry Pi přes 40 pinový header - potřebujete pouze jeden 12V/3A napájecí zdroj&lt;/li&gt;  &lt;li&gt;Integrované konektory XH2.54 výstupního napájení pro napájení ostatních zařízení&lt;/li&gt;  &lt;li&gt;Integrovaný konektor PH2.0, který umožňuje připojit externí vypínač&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s Suptronics X710 napájecí deska&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s Suptronics X735 V2.1 napájecí deska s 5V větráčkem&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Upozornění: &lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;MicroSD karta je zapotřebí K vynucení použití operačního systému Raspbian k použití disku HDD / SSD pro jeho „kořenový“ oddíl je nutná karta microSD.&lt;/li&gt;  &lt;li&gt;Nenapájejte své Raspberry Pi přes standardní napájecí konektor microUSB, ale jen přes tuto desku.&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Specifikace:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Napájecí zdroj: 12V 3A výstup&lt;/li&gt;  &lt;li&gt;Porty:&lt;br /&gt;- DC jack - 5,5x2,5mm&lt;br /&gt;- USB - USB 3.0 type A&lt;/li&gt;  &lt;li&gt;Konektory:&lt;br /&gt;- Napájecí výstupní konektor - XH2.54 2-pin&lt;br /&gt;- SATA konektor - 7+15P samice&lt;/li&gt;  &lt;li&gt;Rozměry: 162,8 x 101,6mm&lt;/li&gt;  &lt;li&gt;Doporučený zdroj: &lt;a href='https://rpishop.cz/zdroje-baterie-powerbanky/3087-cellevia-25x55mm-12v3a-napajeci-zdroj-eu-cerny.html'&gt;Cellevia 2,5x5,5mm 12V?3A napájecí zdroj, EU, černý&lt;/a&gt;&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1 x X832 HDD rozšiřující deska&lt;/li&gt;  &lt;li&gt;1 x GPIO napájecí deska&lt;/li&gt;  &lt;li&gt;1 x Datový kabel USB 3.0 A-samec na A-samec&lt;/li&gt;  &lt;li&gt;1 x 2 pinový kabel pro připojení k GPIO&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek M2,5 x 12mm&lt;/li&gt;  &lt;li&gt;8 x Šroub M2,5 x 5mm&lt;/li&gt;  &lt;li&gt;8 x Šroub M3 x 8mm&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek M3 x 32mm&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","750.00","KS","1.00","6","2021-01-25T16:06:45.84","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551893_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551893_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551893_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551893_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551893_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551893_0f_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.161</weight>          <length>20</length>          <width>13</width>          <height>3.5</height>        </productlogisticdata>      ","N","","false",""),("1551899","1558052","Suptronics přídavná deska X862 M.2 NGFF SATA SSD Shield","562.50","564.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","562.00","562.00","21.00","SUP023","false","0,00","","Raspberry","84733080","1558052","Suptronics přídavná deska X862 M.2 NGFF SATA SSD Shield","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;strong&gt;Suptronics X862 M.2 NGFF SATA SSD Shield&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Rozšiřující deska X862 M.2 NGFF SATA SSD nabízí snadný a rychlý způsob, jak vytvořit velké úložiště pro Vaše Raspberry Pi 4B. Jeho elegantní a ultrakompaktní design umožňuje pohodlné připojení M.2 NGFF SSD k Raspberry Pi. Port SuperSpeed USB 3.0 poskytuje rychlost přenosu dat až 5Gb/s, což vám umožní přenos velkého množství dat během několika sekund. Montážní otvory a distanční sloupky pomáhají chránit jednotku pevného disku a odvádějí teplo.&lt;/p&gt;  &lt;p&gt;Model X862 může být dokonalým řešením úložiště pro vaše domácí multimediální centrum nebo datové úložiště připojené k místní síti (NAS) pro ukládání a streamování vašich vlastních videí, hudby a digitálních fotografií.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Pro použití s - Raspberry Pi 4 Model B&lt;/li&gt;  &lt;li&gt;Operační systém - Všechny operační systémy pro Raspberry Pi&lt;/li&gt;  &lt;li&gt;Ideální řešení pro ukládání pro Raspberry Pi 4 - M.2 NGFF SATA SSD Shield&lt;/li&gt;  &lt;li&gt;Podpora až 2TB M.2 NGFF SSD&lt;/li&gt;  &lt;li&gt;Podporuje různé velikosti M.2 NGFF SSD: 2280, 2260, 2242 a 2230&lt;/li&gt;  &lt;li&gt;Integrovaný můstek z USB 3.1 Gen2 na SATA 6Gb/s&lt;/li&gt;  &lt;li&gt;Integrovaný vysoce účinný step-Down převodník, 3,3V max. 3,5A pro napájení SSD&lt;/li&gt;  &lt;li&gt;Umožňuje spouštění OS z vašeho HDD / SSD, rychlejší spouštění aplikací a kopírování souborů&lt;/li&gt;  &lt;li&gt;USB3.1 Gen1 5Gb/s připojení Plug and Play pro Raspberry Pi 4&lt;/li&gt;  &lt;li&gt;Modrá kontrolka ukazující stav čtení nebo zápisu&lt;/li&gt;  &lt;li&gt;Vlastní externí napájení nebo napájení přes USB&lt;/li&gt;  &lt;li&gt;Integrovaný DC jack a XH2.54 konektor pro dodatečné napájení SSD&lt;/li&gt;  &lt;li&gt;Speciální propojka USB3.1 pro připojení k Raspberry Pi&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X735 pro inteligentní správu napájení a chlazení Raspberry Pi&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X710 pro široké vstupní napětí (6 ~ 36V) a inteligentní správu napájení&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X765 pro napájení přes Ethernet (POE, 5V 5A)&lt;/li&gt;  &lt;li&gt;Plně kompatibilní s X728 pro nepřerušitelný zdroj napájení (18650 UPS, 5,1V/8A, WOL)&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Poznámky:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1) Dodatečná propojka potřebná pro SSD délek 2260, 2242 a 2230 není v balení&lt;/li&gt;  &lt;li&gt;2) MicroSD karta je nutná pro spuštění Raspbian OS a používá HDD / SSD jako svůj „kořenový“ oddíl&lt;/li&gt;  &lt;li&gt;SSD není součástí balení&lt;/li&gt;  &lt;li&gt;Deska je kompatibilní pouze s SSD typu M.2 NGFF SATA&lt;/li&gt;  &lt;li&gt;Stejně jako u všech SSD platí, že nové médium musí být před použitím naformátováno&lt;/li&gt;  &lt;li&gt;Jednotky SSD používají výjimečně výkonná úložná média, která se při zatížení zahřívají&lt;/li&gt;  &lt;li&gt;Starší SSD disky s méně účinnými flash médii nemusí fungovat stejně dobře jako novější disky&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Specifikace:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Napájecí zdroj: &lt;br /&gt;- 5V +/-5% , ?4A - přes USB-C na Raspberry Pi&lt;br /&gt;- 5V přes DC jack nebo XH2.5 konektor - extra napájení pro SSD&lt;/li&gt;  &lt;li&gt;Porty:&lt;br /&gt;- DC jack - 5,5x2,5mm&lt;br /&gt;- USB - USB 3.1 type A&lt;/li&gt;  &lt;li&gt;Konektory:&lt;br /&gt;- Napájecí konektor - XH2.54&lt;br /&gt;- 67Pin M.2 konektor P=0.5mm, H3.2mm, Key B x1&lt;/li&gt;  &lt;li&gt;Rozměry: 87 x 56mm&lt;/li&gt;  &lt;li&gt;Doporučený zdroj: &lt;a href='https://rpishop.cz/zdroje/3091-25x55mm-5v4a-napajeci-zdroj-eu-cerny.html'&gt;2,5x5,5mm 5V?4A napájecí zdroj, EU, černý&lt;/a&gt;&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1 x Deska X862 mSATA SSD shield&lt;/li&gt;  &lt;li&gt;1 x Propojka USB3.1&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek M/F M2,5 x 12mm&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek F/F M2,5 x 8mm&lt;/li&gt;  &lt;li&gt;6 x Šroub M2,5 x 6mm&lt;/li&gt;  &lt;li&gt;1 x Šroub M2,5 x 6mm&lt;/li&gt;  &lt;li&gt;1 x Šroubovák&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","562.00","KS","0.00","6","2021-01-25T15:13:01.04","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551899_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551899_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551899_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551899_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551899_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551899_0f_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.067</weight>          <length>11.5</length>          <width>8.5</width>          <height>3.5</height>        </productlogisticdata>      ","N","","false",""),("1551904","1558053","Suptronics přídavná deska X750 pro napájení a UPS","817.50","819.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","818.00","1073.00","21.00","SUP015","false","0,00","Výprodej","Raspberry","84733080","1558053","Suptronics přídavná deska X750 pro napájení a UPS","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;strong&gt;Suptronics X750 deska pro napájení a UPS&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;X750 je napájecí GPIO rozšiřující deska pro všechny současné modely Raspberry Pi. Poskytuje zálohování napájení 5,1V 8 000 mA, které jistě oceníte při náročnějších projektech s Raspberry Pi. Dále deska řeší inteligentní a bezpečné řízení napájení, bezpečné vypnutí a úplné vypnutí pomocí softwaru.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Pro použití s Raspberry Pi 1 Model B+/ 2 Model B / 3 Model B / 3 Model B+ / 3 Model A+ / 4 Model B&lt;/li&gt;  &lt;li&gt;Operační systém: Raspberry Pi OS (Raspbian) - Funkce bezpečného vypnutí testována na Raspbianu, další operační systémy, budou testovány a poté doporučeny&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;X750 deska pro napájení a UPS&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Inteligentní nepřerušitelný zdroj napájení (UPS)&lt;/li&gt;  &lt;li&gt;Zajišťuje nepřetržitý provoz až 10~30 hodin jen za pomoci baterií (v závislosti na použitém typu a počtu baterií)&lt;/li&gt;  &lt;li&gt;Zálohování napájení 5,1V 8000 mA, což je vhodné i pro ty nejnáročnější projekty&lt;/li&gt;  &lt;li&gt;Držák pro 4 18650 lithium-iontové baterie&lt;/li&gt;  &lt;li&gt;Může pracovat s 2, 3 nebo se 4 lithium-iontovými bateriemi 18650&lt;/li&gt;  &lt;li&gt;Podporuje 2A přes micro-USB nebo 3A přes DC jack rychlé nabíjení&lt;/li&gt;  &lt;li&gt;Integrovaný obvod pro ochrany baterie&lt;/li&gt;  &lt;li&gt;Integrovaná nadproudová ochrana a přepěťová ochrana&lt;/li&gt;  &lt;li&gt;Integrovaný systém pro měření napětí a procentuální vybití baterie přes I2C&lt;/li&gt;  &lt;li&gt;Integrovaný 10A synchronní převodník&lt;/li&gt;  &lt;li&gt;Inteligentní automatické nabíjení a vybíjení&lt;/li&gt;  &lt;li&gt;Integrovaná LED ukazující stav zapnutí a vypnutí&lt;/li&gt;  &lt;li&gt;Inteligentní a bezpečné řízení spotřeby&lt;/li&gt;  &lt;li&gt;Zapnutí napájení stisknutím tlačítka&lt;/li&gt;  &lt;li&gt;Restartování po stisknutí tlačítka po dobu 1 ~ 2 sekund&lt;/li&gt;  &lt;li&gt;Bezpečné vypnutí po stisknutí tlačítka po dobu 3 ~ 7 sekund&lt;/li&gt;  &lt;li&gt;Vynucené vypnutí po stisknutí tlačítka po dobu větší než 8 sekund&lt;/li&gt;  &lt;li&gt;Podpora softwarového bezpečného a úplné vypnutí&lt;/li&gt;  &lt;li&gt;Integrovaná LED ukazující stav zapnutí, restartu a vypnutí&lt;/li&gt;  &lt;li&gt;Integrovaný pinový výstup na desce umožňuje zvolit automatické zapnutí, tedy pokud je výstup napájen nebo je připojena baterie&lt;/li&gt;  &lt;li&gt;Extrémně nízká spotřeba energie v pohotovostním režimu (µA), což vede k delší výdrži baterie&lt;/li&gt;  &lt;li&gt;Pracujte v režimu nabíjení i vybíjení, takže dokáže vyrovnat výkyvy napětí, což přispívá k lepší správě napájení&lt;/li&gt;  &lt;li&gt;Pokročilá systémová správa napájecích cest zabraňuje častému nabíjení a prodlužuje životnost baterie&lt;/li&gt;  &lt;li&gt;Pokročilá systémová správa napájení umožňuje rychlé nabíjení a současně napájet Raspberry Pi 3A&lt;/li&gt;  &lt;li&gt;Napájení Raspberry Pi přes 40-pinový header&lt;/li&gt;  &lt;li&gt;Vestavěný DC jack (5,5 x 2,5 mm) a micro-USB konektor pro napájení&lt;/li&gt;  &lt;li&gt;Integrovaný konektor PH2.0 umožňuje připojit externí vypínač&lt;/li&gt;  &lt;li&gt;Integrované výstupní konektory XH2.54 umožňují napájení dalších zařízení&lt;/li&gt;  &lt;li&gt;Montážní otvory a distanční sloupky zajišťující mechanickou stabilitu sestavy RPi a X750&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;X750-A1 držák 4 baterie 18650&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Do držáku se vejdou až 4 baterie 18650&lt;/li&gt;  &lt;li&gt;Ideální řešení pro zvýšení kapacity (celková kapacita baterie je až 38400mAh -při připojení 12 baterií 18650)&lt;/li&gt;  &lt;li&gt;Integrovaný obvod ochrany baterie&lt;/li&gt;  &lt;li&gt;Montážní otvory a distanční sloupky zajišťující mechanickou stabilitu sestavy RPi a X750&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Poznámky:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Pokročilá správa napájení je aktivní, když je napájena před DC jack&lt;/li&gt;  &lt;li&gt;Nepoužívejte napájení Raspberry Pi prostřednictvím micro USB nebo USB-C konektoru&lt;/li&gt;  &lt;li&gt;Nepoužívejte baterii 18650 se zabudovaným ochranným obvodem&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Specifikace:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Napájecí zdroj: &lt;br /&gt;- přes Micro-USB: 4,7~5,5V, 2,5A&lt;br /&gt;- přes DC jack (5,5 x 2,5 mm): 4,7~5,5V ±5%, ?4A&lt;/li&gt;  &lt;li&gt;UPS výstup : 5.1V ±5% Max 8A&lt;/li&gt;  &lt;li&gt;UPS nabíjecí proud: 2A přes Micro-USB , 3A přes DC jack&lt;/li&gt;  &lt;li&gt;Terminální napětí baterie : 4,2V&lt;/li&gt;  &lt;li&gt;Limit nabití : 4,1V&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1 x Deska X750&lt;/li&gt;  &lt;li&gt;1 x Napájecí GPIO deska&lt;/li&gt;  &lt;li&gt;1 x 8-pinový propojovací kabel&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek F/F M2,5 x 22mm&lt;/li&gt;  &lt;li&gt;4 x Distanční sloupek F/M M2,5 x 22mm&lt;/li&gt;  &lt;li&gt;8 x Šroub M2,5 x 5mm&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","2","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","818.00","KS","0.00","7","2021-01-25T15:42:25.197","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551904_0g_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.143</weight>          <length>15.5</length>          <width>10.5</width>          <height>4</height>        </productlogisticdata>      ","N","","false",""),("1551908","1558054","Suptronics X873 V1.2 M.2 SSD Shield","917.50","919.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","918.00","918.00","21.00","SUP010","false","0,00","Dočasně nedostupné","Raspberry","84733080","1558054","Suptronics X873 V1.2 M.2 SSD Shield","Druh příslušenství k PC:Ostatní","1","Rozšiřující deska X873 V1.2 M.2 SSD Shield nabízí snadný a rychlý způsob, jak