   ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.067</weight>          <length>11.5</length>          <width>8</width>          <height>3</height>        </productlogisticdata>      ","N","","false",""),("1551909","1558055","Suptronics přídavná deska X728 UPS deska pro inteligentní napájení","854.50","856.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","854.00","854.00","21.00","SUP021","false","0,00","","Raspberry","84733080","1558055","Suptronics přídavná deska X728 UPS deska pro inteligentní napájení","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;&lt;strong&gt;Suptronics X728 UPS deska pro inteligentní napájení&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;X728 je multifunkční GPIO rozšiřující deska pro všechny současné modely Raspberry Pi. 5,1V 8000mA záložní napájení pro nejnáročnější projekty na Raspberry Pi. Poskytuje inteligentní a bezpečnou správu napájení, bezpečné vypnutí  detekce ztráty napájecího zdroje / výpadku napájecího adaptéru, automatické zapnutí, úplné vypnutí softwaru a RTC hodiny v reálného času. X728 přpojíte na GPIO a lze stohovat i s dalšími deskami pro rozšíření možností Raspberry Pi. X728 lze také použít s rozšiřujícími deskami X872, X825, a X828 (HDD / SSD Shield) pro bezpečné zálohování dat.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vlastnosti:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Pro použití s Raspberry Pi 1 Model B+/ 2 Model B / 3 Model B / 3 Model B+ / 3 Model A+ / 4 Model B&lt;/li&gt;  &lt;li&gt;Operační systém: Raspberry Pi OS (Raspbian) - Funkce bezpečného vypnutí testována na Raspbianu, další operační systémy, budou testovány a poté doporučeny&lt;/li&gt;  &lt;li&gt;Inteligentní nepřerušitelný zdroj napájení (UPS)&lt;/li&gt;  &lt;li&gt;Zajišťuje nepřetržitý provoz 10-30 hodin jen za pomoci baterií (v závislosti na použitém typu baterie a množství)&lt;/li&gt;  &lt;li&gt;Zálohování napájení 5,1V 8000 mA, což je vhodné i pro ty nejnáročnější projekty&lt;/li&gt;  &lt;li&gt;Držák pro 2 18650 lithium-iontové baterie&lt;/li&gt;  &lt;li&gt;Může pracovat s jednou nebo se dvěma lithium-iontovými bateriemi 18650&lt;/li&gt;  &lt;li&gt;Podporuje 3A rychlé nabíjení&lt;/li&gt;  &lt;li&gt;Integrovaný obvod pro ochrany baterie&lt;/li&gt;  &lt;li&gt;Integrovaná nadproudová ochrana a přepěťová ochrana&lt;/li&gt;  &lt;li&gt;Integrovaný systém pro měření napětí a procentuální vybití baterie přes I2C&lt;/li&gt;  &lt;li&gt;Integrovaný 10A synchronní převodník&lt;/li&gt;  &lt;li&gt;Inteligentní automatické nabíjení a vybíjení&lt;/li&gt;  &lt;li&gt;Automatické bezpečné vypnutí při nízkém stavu baterie (napětí &amp;lt;3,0V)&lt;/li&gt;  &lt;li&gt;Integrované 4 zelené LED indikující úrovně nabíjení a vybíjení baterie 25%, 50%, 75% a 100%&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Inteligentní a bezpečné řízení spotřeby&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Zapnutí napájení stisknutím tlačítka&lt;/li&gt;  &lt;li&gt;Restartování po stisknutí tlačítka po dobu 1 ~ 2 sekund&lt;/li&gt;  &lt;li&gt;Bezpečné vypnutí po stisknutí tlačítka po dobu 3 ~ 7 sekund&lt;/li&gt;  &lt;li&gt;Vynucené vypnutí po stisknutí tlačítka po dobu větší než 8 sekund&lt;/li&gt;  &lt;li&gt;Podpora softwarového bezpečného a úplné vypnutí&lt;/li&gt;  &lt;li&gt;Integrovaná LED ukazující stav zapnutí, restartu a vypnutí&lt;/li&gt;  &lt;li&gt;Detekce ztráty napájení nebo selhání napájecího adaptéru (detekce LED a GPIO)&lt;/li&gt;  &lt;li&gt;Volitelná možnost povolení automatického zapnutí při zapnutí nebo obnovení napájení&lt;/li&gt;  &lt;li&gt;Automatické bezpečné vypnutí při nízkém stavu baterie (napětí &amp;lt;3,0V)&lt;/li&gt;  &lt;li&gt;Ultra nízká spotřeba energie v pohotovostním režimu pro maximalizaci výdrže baterie&lt;/li&gt;  &lt;li&gt;Integrovaná průchozí cesta IN-to-SYS pro zavedení vstupního napětí do systému&lt;/li&gt;  &lt;li&gt;Pokročilá správa systému napájení zabraňuje častému nabíjení a vybíjení baterií&lt;/li&gt;  &lt;li&gt;Pokročilá správa systému napájení umožňuje současné rychlé nabíjení a napájení Raspberry Pi&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Integrované hardwarové hodiny reálného času (RTC) se záložní baterií&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Udržuje údaj o aktuálním čase, i když je Raspberry Pi vypnuté&lt;/li&gt;  &lt;li&gt;Umožňuje Raspberry Pi načíst aktuální datum a čas po opětovném zapnutí&lt;/li&gt;  &lt;li&gt;Používá nejběžnější hodiny reálného času DS1307&lt;/li&gt;  &lt;li&gt;Používá baterii 18650 k udržování data a času - není potřeba žádná další baterie&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Další&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Funguje se všemi současnými modely Raspberry Pi pomocí GPIO headeru - není nutná žádná další kabeláž&lt;/li&gt;  &lt;li&gt;Integrovaný DC konektor (5,5 x 2,5 mm) a USB-C konektor pro napájení&lt;/li&gt;  &lt;li&gt;Integrovaný konektor PH2.0 umožňuje připojení například externího vypínače&lt;/li&gt;  &lt;li&gt;Integrovaný výstupní konektor napájení XH2.54 umožňuje napájení dalších zařízení&lt;/li&gt;  &lt;li&gt;GPIO pro připojení s dalšími rozšiřujícími moduly nebo příslušenství pro Raspberry Pi&lt;/li&gt;  &lt;li&gt;Montážní otvory a distanční sloupky zajišťující mechanickou stabilitu sestavy RPi a X728&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Poznámky:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Nepoužívejte napájení Raspberry Pi prostřednictvím micro USB nebo USB-C konektoru&lt;/li&gt;  &lt;li&gt;Nepoužívejte baterii 18650 se zabudovaným ochranným obvodem&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Specifikace:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Napájení:&lt;br /&gt;- přes USB-C: 5Vdc, 3A&lt;br /&gt;- přes DC jack: 5Vdc ±5%, ?4A&lt;/li&gt;  &lt;li&gt;UPS výstup : 5.1V ±5% Max 8A&lt;/li&gt;  &lt;li&gt;UPS nabíjecí proud: 2,3-3,2A&lt;/li&gt;  &lt;li&gt;Terminální napětí baterie : 4,24V&lt;/li&gt;  &lt;li&gt;Limit nabití : 4,1V&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;&lt;br /&gt;Obsah balení:&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;1 x Deska X728&lt;br /&gt;4 x Distanční sloupek F/F M2.5 *20mm&lt;br /&gt;4 x Distanční sloupek F/M M2.5 *20mm&lt;br /&gt;8 x Šroub M2.5 x 8mm&lt;br /&gt;3 x 2 pinová spojka 2,54mm&lt;/li&gt;  &lt;/ul&gt;","false","0","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","854.00","KS","0.00","7","2021-01-25T16:05:12.383","RSB","122","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1551\/1551909_0g_3.jpg'}","        <productnavigatordata>          <attributecode>196</attributecode>          <valuecode>1264</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.113</weight>          <length>12</length>          <width>9.5</width>          <height>4.5</height>        </productlogisticdata>      ","N","","false",""),("1552049","1558057","Vývojová deska ESP32 Development board","190.50","192.00","RSP","1.50","0.00","0.000000","0.000","12 Měsíc(ů)","RASPBERRY","190.00","205.00","21.00","TIB038","false","0,00","","Raspberry","84733080","1558057","Vývojová deska ESP32 Development board","Druh příslušenství k PC:Ostatní","1","&lt;p&gt;ESP32 je vývojová deska pro Vaše další projekty.&lt;/p&gt;  &lt;p&gt;ESP32 je vývojová deska s již integrovanou anténou a RF balunem, výkonovým zesilovačem, nízkošumovými zesilovači, filtry a modulem řízení spotřeby.&lt;/p&gt;  &lt;p&gt;Tato deska má navíc integrované dual-core processor s 2.4 GHz Wi-Fi a Bluetooth čipy s technologií TSMC 40nm s nízkou spotřeb