 12px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;p style='margin: 0px 0px 1em; padding: 0px; text-align: left; line-height: 1.5em; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px; display: block;'&gt;bbc micro:bit „Go Bundle' je perfektním základem pro BBC. Kromě desky micro:bit desky tak máte k dispozici také příslušenství potřebné k provozu.&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;micro:bit V2 je výkonný nástupce velmi úspěšného jednodeskového počítače. Druhá generace BBCs je vybavena vestavěným reproduktorem a mikrofonem. Díky tomuto upgradu umožňuje BBC micro:bit V2 stejné skvělé funkce s dodatečnou možností dotyku a zvuku ve třídě.&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;&lt;strong style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;Přehled změn:&lt;/strong&gt;&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Integrovaný reproduktor&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;MEMS mikrofon s LED ukazatelem&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Nový procesor Nordic Semiconductor nRF52833&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Dotykové logo&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Vestavěný režim spánku / vypnutí, tzn. kartu lze vypnout pomocí připojených baterií&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Diskrétní regulátor, který poskytuje proud až 200 mA na externím příslušenství&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;&lt;strong style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;Was BBC micro:bit?&lt;/strong&gt;&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;BBC micro:bit je jednodeskový počítač, který byl původně vyvinut pouze pro školy. Vzhledem k velké poptávce je nyní kalkulačka k dispozici také na volném trhu. Minipočítač o velikosti 4 x 5 cm je vhodný jak pro začátečníky, tak i pro zkušené kutily.&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Deska je již vybavena LED maticí 5x5, který je určen k vydávání, magnetometrem a 3-osým akcelerometrem. Kromě toho disponuje technologií Bluetooth, dvěma programovatelnými tlačítky a 20 vstupními/výstupními piny.&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;To znamená: Můžete začít s prvními projekty, aniž byste museli nakupovat elektroniku. Na vlastní internetové stránce micro:bit naleznete podporu ve formě výukových programů a cvičení.&lt;br style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;' /&gt;Začátečníci i profesionálové budou mít radost z toho, že se s BBC micro:bit. Pro kalkulačky jsou k dispozici čtyři programovací povrchy: Code Kingdoms JavaScript, Microsoft Blocks, Microsoft Touch Develop a MicroPython. Díky tomu je možné programování graficky nebo pomocí textových editorů. Praktické je kromě programování na PC přes USB připojení také programování přes smartphone nebo tablet.&lt;/p&gt;  &lt;/div&gt;  &lt;div class='section' style='margin: 0px 0px 1.5em; padding: 0px; text-align: left; color: #474747; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;h3 style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;Technické parametry&lt;/h3&gt;  &lt;div class='fr_attributes_product attr_2308377' style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;  &lt;table class='table_atributes' style='margin: 0px; padding: 0px; width: 728.01px; text-align: left; clear: both; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 11px; border-collapse: collapse;'&gt;  &lt;tbody style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;  &lt;tr style='margin: 0px; padding: 0px; text