;'&gt;Vestavěný režim automatického vypnutí&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;div class='section' style='margin: 0px 0px 1.5em; padding: 0px; text-align: left; color: #474747; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;h3 style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;Vlastnosti&lt;/h3&gt;  &lt;ul style='margin: 0px; padding: 0px; text-align: left; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px; list-style-position: outside; list-style-image: url('/templates/img/elements/pointer_yellow_circle.png');'&gt;  &lt;li style='margin: 0px 0px 0px 15px; padding: 0px; text-align: left; line-height: 1.5em; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;Provoz přes zdířku microUSB na PC nebo přes 2 baterie AAA&lt;/li&gt;  &lt;li style='margin: 0px 0px 0px 15px; padding: 0px; text-align: left; line-height: 1.5em; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;matici 5x5 LED pro zobrazení blikající textů, alfanumerických znaků a vzorů&lt;/li&gt;  &lt;li style='margin: 0px 0px 0px 15px; padding: 0px; text-align: left; line-height: 1.5em; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;dvě programovatelná tlačítka pro použití jako herní ovladač, Ovládání hudby na vlastním smartphonu a mnoho dalšího&lt;/li&gt;  &lt;li style='margin: 0px 0px 0px 15px; padding: 0px; text-align: left; line-height: 1.5em; font-family: Tahoma, Arial, Helvetica, sans-serif; font-size: 12px;'&gt;On Board detektor pohybu